class Solution(object):
    def maximumValueSum(self, board):
        """
        :type board: List[List[int]]
        :rtype: int
        """
        m = len(board)
        n = len(board[0])
        maxsum = float("-inf")
        maxes = [[] for i in range(m)]
        for i in range(m):
            ilist = [(board[i][j],j) for j in range(n)]
            ilist.sort(reverse=True)
            ilist = ilist[:3]
            maxes[i] = ilist
        for i in range(m-2):
            for ij in range(3):
                for j in range(i+1,m-1):
                    for jj in range(3):
                        if maxes[j][jj][1]==maxes[i][ij][1]: continue
                        for k in range(j+1,m):
                            for kj in range(3):
                                if maxes[k][kj][1]==maxes[j][jj][1] or maxes[k][kj][1]==maxes[i][ij][1]: continue
                                maxsum = max(maxsum,maxes[i][ij][0]+maxes[j][jj][0]+maxes[k][kj][0])
        return maxsum
